import React from 'react';
import logo from './logo.svg';
import Topbar from './Components/Topbar';
import './App.css';

import MainComponent from './Components/MainComponent'

import imgMB from './Images/MichaelBurry.jpg';
import imgWB from './Images/Warren_Buffett.jpg';
import imgKG from './Images/Ken_Griffin.jpg';

import imgJB from './Images/JeffBezos.png';
import imgJM from './Images/JoeMansueto.jpg';
import imgMZ from './Images/MarkZuckerberg.jpg';

var business1 = {
  image1: imgMB,
  image2: imgWB,
  image3: imgKG,

  name1: "Michael Burry",
  name2: "Warren Bufett",
  name3: "Kenneth Griffin",
}

var business2 = {
  image1: imgJB,
  image2: imgJM,
  image3: imgMZ,

  name1: "Jeffrey Bezos",
  name2: "Joe Mansueto",
  name3: "Mark Zuckerberg",
}



function App() {
  return (
    <div>
      <Topbar />
      <MainComponent data = {business1} />
      <MainComponent data = {business2} />
    </div>
  )
}
